function getRectCrossPt(t, e, r) {
    var a;
    var i = {x: -1, y: -1};
    var o = {x: -1, y: -1};
    var n = r.x - e.x;
    var s = r.y - e.y;
    if (Math.abs(n) < 2) {
        i = {x: e.x, y: t.top};
        o = {x: r.x, y: t.bottom};
        a = [i, o];
        return a
    }
    var h = s / n;
    o.x = t.right;
    o.y = e.y + (t.right - e.x) * h;
    i.x = t.left;
    i.y = e.y + (t.left - e.x) * h;
    a = [i, o];
    return a
}
